import { useHistory } from "react-router";
import "./Search.css"
import { useState, useEffect } from "react"
import Axios from "axios"
import {useLayoutEffect} from  "react"
import TextField from "@material-ui/core/TextField";
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import ListSubheader from '@mui/material/ListSubheader';
import Select from '@mui/material/Select';
import OutlinedInput from '@mui/material/OutlinedInput';




let options = []

function Search() {
    let [selectedOption, setSelectedOption] = useState(null);
    let [cars, setCars] = useState([])
    let [colors, setColors] = useState([])

    useEffect(async () => {
        const result = await Axios.get('http://localhost:3001/auto', {
        })
        setCars(result.data.cars[0])
        setColors(result.data.colors[0])
    }, [])


    cars.forEach(car => {
        options.push({label: car.name, value: car.name})
    })

    return (
        <div>
            <FormControl sx={{ m: 1, width: 300 }}>
            <InputLabel id="demo-multiple-name-label">Auto</InputLabel>
            <Select options={options}>
            </Select>
            </FormControl>
        </div>
    );
}

  export default Search;
